import React from 'react';
import { Typography, Link, Grid, CssBaseline, Paper, Avatar, TextField, Button, Box, Container } from '@mui/material';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Head from '../../composants/Head/index.jsx';

// Composant MadeWithLove
const MadeWithLove = () => (
    <Typography variant="body2" color="textSecondary" align="center">
        {'Built with love by the '}
        <Link color="inherit" href="https://material-ui.com/">
            Material-UI
        </Link>
        {' team.'}
    </Typography>
);

// Composant SignInSide
const SignUpSide = () => {
    return (
        <>
            <Head />
            <Container component="main" maxWidth="xs">
                <CssBaseline />
                <Box sx={{
                    marginTop: 8,
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    '& .MuiTextField-root': {
                        margin: 1,
                        width: '100%'
                    },
                    '& .MuiButton-root': {
                        marginTop: 3,
                        marginBottom: 2
                    }
                }}>
                    <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
                        <LockOutlinedIcon />
                    </Avatar>
                    <Typography component="h1" variant="h5">
                        Sign in
                    </Typography>
                    <Box component="form" noValidate sx={{ mt: 1 }}>
                        <TextField required variant="outlined" margin="normal" id="nom" label="Nom" name="nom" autoFocus />
                        <TextField required variant="outlined" margin="normal" id="prenom" label="Prénom" name="prenom" />
                        <TextField required variant="outlined" margin="normal" id="email" label="Email Address" name="email" autoComplete="email" />
                        <TextField required variant="outlined" margin="normal" id="password" label="Password" name="password" type="password" autoComplete="current-password" />
                        <TextField required variant="outlined" margin="normal" id="telephone" label="Téléphone" name="telephone" />
                        <TextField required variant="outlined" margin="normal" id="dateNaissance" label="Date de Naissance" name="dateNaissance" type="date" InputLabelProps={{ shrink: true }} />
                        <TextField required variant="outlined" margin="normal" id="lieuNaissance" label="Lieu de Naissance" name="lieuNaissance" />
                        <TextField required variant="outlined" margin="normal" id="regionResidence" label="Région de Résidence" name="regionResidence" />
                        <TextField required variant="outlined" margin="normal" id="profession" label="Profession" name="profession" />
                        <TextField required variant="outlined" margin="normal" id="nomEntreprise" label="Nom de l'Entreprise" name="nomEntreprise" />
                        <TextField required variant="outlined" margin="normal" id="chiffreAffaire" label="Chiffre d'Affaire" name="chiffreAffaire" type="number" />
                        <Button
                            type="submit"
                            fullWidth
                            variant="contained"
                            color="primary"
                            sx={{ mt: 3, mb: 2 }}
                        >
                            Sign In
                        </Button>
                        <MadeWithLove />
                    </Box>
                </Box>
            </Container>
        </>
    );
};

export default SignUpSide;
